import siteLogo from '../../assets/images/siteLogo.png';

const NavItems = [
  {
    logo: siteLogo,
    alt: 'Prudence Concept Logo',
    link: [
      '/',
      '/donor',
      '/patient',
      '/dashboard',
      '/login',
      '/register',
    ],
    title: [
      'Blood Bank App',
      'Donor',
      'Patient',
      'Profile',
      'Login',
      'Sign up',
    ],
  },
];

export default NavItems;
